import React, { Component } from 'react';

class A extends Component{
    constructor(props){
        super(props);
        this.state = {
            tambah: "Tambah Mobil"
        }
    }
    
    handleTambahMbl = () => {
        this.setState({
        visible: true,
        });
    };

    componentDidMount(){
        alert('WELKAAMMM!!!!');
    }
    render(){
        return(
            <button onClick={this.handleTambahMbl}>Tambah Mobil</button>
        )
    }
}

export default A;
